import React from 'react';

import {Link} from 'react-router-dom'

import './styles.css'

import {FiChevronLeft}from 'react-icons/fi';

import CardImg from '../../assets/FrontCardEmpty.svg'; 

import iconImg  from '../../assets/IconCard.svg';

function Pagamento() {
  return (
    <div className="pagamento-container">
    <div className="content">
      <section>

      <Link className="back-link" to="/">
           <FiChevronLeft size={16} color="#DE4B4B" />
                       Não tenho cadastro
         </Link>


        <div className="content-text">
          <img src={iconImg} alt="Card"/>
          <span >Adicione um novo cartão de crédito</span>

        </div>
          {/* <h1>
            <img src={iconImg} alt="Card"/>
            Faça seu cadastro, da ONG hhhhhhhhhhhhhh hhhhhhhhhhhh hhhhhhhhhhhhhhhhh hhhhhhhhhhhhhhhhhhhhhh
          </h1>  */}
          

       

        <img src={CardImg} style={{paddingLeft:77}} alt="Demo Shop"/> 
         

      </section>

      {/* <form onSubmit={handleRegister}> */}
      <form >

        {/* <input 
         placeholder="Nome da ONG"
         value={name}
         onChange={e => setName(e.target.value)}
         /> */}
        <input 
         placeholder="Numero do Cartão"
         
         />
        {/* <input 
         type="email" 
         placeholder="E-mail"
         value={email}
         onChange={e => setEmail(e.target.value)}
        /> */}
        <input         
         placeholder="Nome (igual ao cartão)"
         
        />
        {/* <input 
         placeholder="WhatsApp"
         value={whatsapp}
         onChange={e => setWhatsapp(e.target.value)}
        /> */}
        
        <div className="input-group">

          {/* <input 
            placeholder="Cidade"
            value={city}
            onChange={e => setCity(e.target.value)}
          />
          <input 
            placeholder="UF" 
            style={{ width:80}}
            value={uf}
            onChange={e => setUf(e.target.value)}
          /> */}

          <input 
            placeholder="Validade"
            
          />
          <input 
            placeholder="CVV" 
            
            
          />

        </div>

        <input 
         placeholder="Numeros Parcelas"
         
        />

        <button className="buttonPagamento" type="submit">Continuar</button>

      </form>
    </div>
  </div>
  );
}

export default Pagamento;
